import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import "./App.css";
import Jeff from "./pages/Home.jsx";
import { UnderConstruction } from "./pages/UnderConstruction";
import MapDisplay from "./pages/Map.jsx";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Router>
          <Switch>
            <div>
              <Route exact path="/" component={Jeff} />
              <Route path="/home" component={Jeff} />
              <Route path="/underdev" component={UnderConstruction} />
              <Route path="/game" component={MapDisplay} />
              <Route path="/map" component={MapDisplay} />
            </div>
          </Switch>
        </Router>
      </React.Fragment>
    );
  }
}

export default App;
